package Easy;

import java.util.Scanner;

public class plantillaScanner {

	public static void main(String[] args) throws Exception {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in); 
		String line = sc.next();
		
		while (line != null) {
			
			line = sc.next();
		}
		sc.close();
	}
}
